import React, { Component } from 'react';
import ReactDOM from 'react-dom';
import Header from './Header';
import Log from './Log';
import '../css/App.css';
import * as serviceWorker from './serviceWorker';



export default class App extends Component {

  componentDidMount() {

    if (process.env.NODE_ENV !== 'production') {
      localStorage.setItem('debug', 'resume-react-app:*');
      console.log("Dev Mode Detected... setting debug name.");
    }

    document.addEventListener("DOMContentLoaded", function(event) {
      //Load up the various modules
      ReactDOM.render(<Header />, document.getElementById('App'));
    });

    Log.info('Hello from App Component!', 'App Component');
    Log.error(`Oh oh! Something's wrong!`, `App Component`);
  }
  render() {
    return (
      <div id="App" className="App">
      </div>
    );
  }
}
